import React, { useState, useMemo } from 'react';
import { useNavigate } from 'react-router-dom';
import { mockSpecializations, mockDoctors, mockAppointments, mockUser } from '../../mockData';
import '../styles/Dashboard.css';

/**
 * Dashboard Component - Medical Specialization & Doctor Browser
 * 
 * MEDIBOOK - Refactored for Medical-Only Appointments
 * 
 * Learning Goals:
 * 1. Two-level hierarchy: Specializations ‚Üí Doctors
 * 2. Array filtering for dependent data
 * 3. useMemo for performance optimization
 * 4. Conditional rendering with multiple states
 * 
 * React Concepts:
 * - map() transforms arrays into JSX
 * - filter() finds relevant doctors by specialization
 * - useMemo() prevents unnecessary re-renders
 * - State dependencies: selectedSpecialization ‚Üí filteredDoctors
 */

function Dashboard() {
  const navigate = useNavigate();
  
  // State: Step 1 - Select Specialization
  const [selectedSpecialization, setSelectedSpecialization] = useState(null);
  
  // State: Step 2 - Search within doctors
  const [searchTerm, setSearchTerm] = useState('');

  /**
   * React Concept: useMemo - Performance Optimization
   * 
   * WHY: filteredDoctors depends on selectedSpecialization and searchTerm
   * When these change, recalculate. Otherwise, use cached result.
   * This prevents unnecessary rendering of the entire doctor list.
   */
  const filteredDoctors = useMemo(() => {
    if (!selectedSpecialization) return [];
    
    return mockDoctors
      .filter(doctor => doctor.specializationId === selectedSpecialization.id)
      .filter(doctor => 
        doctor.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        doctor.qualifications.toLowerCase().includes(searchTerm.toLowerCase())
      );
  }, [selectedSpecialization, searchTerm]);

  /**
   * Handle booking navigation
   * Pre-fill booking form with selected doctor
   */
  const handleBookDoctor = (doctor) => {
    navigate('/booking', { state: { selectedDoctor: doctor } });
  };

  return (
    <div className="dashboard-container">
      {/* Header */}
      <div className="dashboard-header">
        <h1>üëã Welcome, {mockUser.name}!</h1>
        <p>Book your medical appointment with top doctors</p>
      </div>

      {/* Search Bar */}
      <div className="search-section">
        <input
          type="text"
          placeholder="Search for doctors, services..."
          className="search-input"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      {/* Quick Actions */}
      <div className="quick-actions">
        <button className="action-btn" onClick={() => navigate('/my-appointments')}>
          üìÖ My Appointments ({mockAppointments.length})
        </button>
        <button className="action-btn" onClick={() => navigate('/profile')}>
          üë§ My Profile
        </button>
      </div>

      {/* Services List */}
      <div className="services-section">
        <h2>Available Services</h2>
        
        {filteredServices.length === 0 ? (
          <p className="no-results">No services found matching your search.</p>
        ) : (
          // map() - Transform array of services into array of JSX cards
          <div className="services-grid">
            {filteredServices.map((service) => (
              <div key={service.id} className="service-card">
                {/* Service Header with Icon */}
                <div className="service-icon">{service.image}</div>
                
                {/* Service Info */}
                <h3>{service.name}</h3>
                <p className="service-type">{service.type}</p>
                
                {/* Details */}
                <div className="service-details">
                  <p>üí∞ ‚Çπ{service.price}</p>
                  <p>‚è±Ô∏è {service.duration} mins</p>
                  <p>‚≠ê {service.experience}</p>
                </div>
                
                <p className="service-description">{service.description}</p>
                
                {/* Book Now Button */}
                <button 
                  className="book-btn"
                  onClick={() => handleBookNow(service)}
                >
                  Book Now ‚Üí
                </button>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Info Section */}
      <div className="info-section">
        <h3>‚ÑπÔ∏è How it works?</h3>
        <ol>
          <li><strong>Browse Services:</strong> View all available doctors and services</li>
          <li><strong>Select Date & Time:</strong> Choose convenient time slots</li>
          <li><strong>Confirm Booking:</strong> Complete your appointment booking</li>
          <li><strong>Receive Confirmation:</strong> Get email and SMS confirmation</li>
        </ol>
      </div>
    </div>
  );
}

export default Dashboard;
